import React from 'react'
import { GoogleMap, useJsApiLoader, Polygon,Marker, Inf } from '@react-google-maps/api';

const containerStyle = {
  width: '400px',
  height: '400px'
};

const center = {
  lat: -3.745,
  lng: -38.523
};

function MyComponent() {
  const { isLoaded } = useJsApiLoader({
    id: 'google-map-script',
    googleMapsApiKey: "AIzaSyDF012B-uaHA1lmKxbNb0fVpn4zToVaDZM"
  });

  const [map, setMap] = React.useState(null);

  const onLoad = React.useCallback(function callback(map) {
    // This is just an example of getting and using the map instance!!! don't just blindly copy!
    const bounds = new window.google.maps.LatLngBounds(center);
    map.fitBounds(bounds);

    setMap(map)
  }, [])

  const onUnmount = React.useCallback(function callback(map) {
    setMap(null)
  }, [])

  return isLoaded ? (
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={center}
        zoom={10}
        onLoad={onLoad}
        onUnmount={onUnmount}
      >
        { /* Child components, such as markers, info windows, etc. */ }
        <MarkerComponent />
        <InfoWindowComponent />
        <PolygonComponent />
        <CircleComponent />
      </GoogleMap>
  ) : <></>
}

export default React.memo(MyComponent)

// Sample Marker Component
function MarkerComponent() {
  return (
    <Marker position={center} />
  );
}

// Sample InfoWindow Component
function InfoWindowComponent() {
  const infoWindowContent = "This is an example info window.";
  return (
    <InfoWindow position={center}>
      <div>{infoWindowContent}</div>
    </InfoWindow>
  );
}

// Sample Polygon Component
function PolygonComponent() {
  const polygonOptions = {
    paths: [
      { lat: -3.7, lng: -38.5 },
      { lat: -3.7, lng: -38.6 },
      { lat: -3.8, lng: -38.6 },
    ],
    fillColor: 'blue',
    fillOpacity: 0.5,
    strokeColor: 'red',
  };
  return (
    <Polygon options={polygonOptions} />
  );
}

// Sample Circle Component
function CircleComponent() {
  const circleOptions = {
    center,
    radius: 10000, // Radius in meters
    fillColor: 'yellow',
    fillOpacity: 0.5,
    strokeColor: 'orange',
  };
  return (
    <Circle options={circleOptions} />
  );
}
